import {Component, OnInit} from '@angular/core';
import {CommonService} from '../../shared/services/common.service';
import {ReportService} from '../../shared/services/report.service';
import 'jspdf';
import {UserService} from '../../shared/services/user.service';
declare let jsPDF: any;

@Component({
  selector: 'app-reports',
  templateUrl: './reports.component.html',
  styleUrls: ['./reports.component.scss']
})
export class ReportsComponent implements OnInit {
  public startDate: string;
  public endDate: string;
  public selectedReportType: string;
  public productSales: any;
  public brandSales: any;
  public loading: boolean;
  emptyTable: boolean = true;
  public jsPdfDoc: any;

  constructor(private commonService: CommonService, private reportService: ReportService, private userService: UserService) {
    this.selectedReportType = 'product-sales-report';
    this.loading = false;
    this.jsPdfDoc = new jsPDF('p', 'pt');
  }

  ngOnInit() {
  }

  getReports(value) {
    this.loading = true;

    let param = {
      marketPlaceId: this.userService.supplierID,
      startDate: value.startDate ? value.startDate.toISOString() : '',
      endDate: value.endDate ? value.endDate.toISOString() : ''
    };

    switch (value.reportType) {
      case 'brand-sales-report':
        this.reportService.getBrandSales(param)
          .subscribe((data: any) => {
            this.brandSales = data.data.brand_sales;
            this.loading = false;
            this.emptyTable = false;

            console.log(data);
          });
        break;
      case 'product-sales-report':
        this.reportService.getProductSales(param)
          .subscribe((data: any) => {
            this.productSales = data.data.product_sales;
            this.loading = false;
            this.emptyTable = false;
            this.convert(data.data.product_sales);
            console.log(data);
          });
        break;
    }
  }

  convert(data: any) {
    var col = [
      {title: 'Product ID', dataKey: 'product_id'},
      {title: 'Product Name', dataKey: 'product_name'},
      {title: 'Quantity', dataKey: 'quantity'},
      {title: 'Total', dataKey: 'total'},
    ];
    this.jsPdfDoc.autoTable(col, data, {
      addPageContent: this.pageContent.bind(this),
      margin: {top: 200},
      createdCell: function (cell, data) {
        if (data.column.dataKey === 'total') {
          cell.text = 'Rs. '+ parseFloat(cell.text).toFixed(2).replace(/(\d)(?=(\d{3})+\.)/g, '$1,');;
        }
      }
    });
    this.jsPdfDoc.save('Report.pdf');
  }

  pageContent(data) {
    let logo = 'data:image/png;base64,';
    let text = 'Product Sales Report';
    this.jsPdfDoc.setFontSize(20);
    this.jsPdfDoc.setTextColor(40);
    this.jsPdfDoc.setFontStyle('normal');
    this.jsPdfDoc.addImage(logo, 'PNG', data.settings.margin.left, 30, 200, 100);
    let xOffset = (this.jsPdfDoc.internal.pageSize.width / 2) - (this.jsPdfDoc.getStringUnitWidth(text) * this.jsPdfDoc.internal.getFontSize() / 2);
    this.jsPdfDoc.text(text, xOffset, 30);
  }
}
